INSERT INTO `messages` VALUES (1,1,'Lottogewinn','<h2>Herzlichen Glückwunsch!</h2>\r\n<p>Sie haben an unserem Lottoevent teilgenommen und Gewonnen.</p>\r\n\r\n<table style=\"border-spacing: 15px 0;\">\r\n    <tr>\r\n        <td><b>Event:</b></td>\r\n        <td>#EVENT#</td>\r\n    </tr>\r\n    <tr>\r\n        <td><b>Serie:</b></td>\r\n        <td>#SERIE#</td>\r\n    </tr>\r\n    <tr>\r\n        <td><b>Gewinn:</b></td>\r\n        <td>#GEWINN#</td>\r\n    </tr>\r\n</table>\r\n\r\n<p>Bitte melden sie sich zwecks empfang ihres Preises beim Zakaria Agulif.<br>Tel: 079 000 00 00<br>E-Mail: zaki@lotto.local</p>\r\n<p>Hinweis: Gewinne können nicht zurückgegeben oder in Bargeld umgetauscht werden.</p>','noreply@lotto.local',1),(2,2,'Ihr neues Passwort','<h2>Ihr neues Passwort</h2> <p>Ihr neues Passwort lautet: <code>#password#</code></p>','noreply@lotto.local',1);
